er mimic of more than 200 voices and currently has a Las Vegas Show at the Tropicana Hotel. Rich Little has a voice for every administration including U.S. Presidents: John F. Kennedy, Lyndon Johnson, Richard Nixon, Gerald Ford, Jimmy Carter, Ronald Reagan, Bill Clinton, both George Bushes and Barack Obama. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagans presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, You do me better than I do.\\n\\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people hes impersonated and some of the funny stories that happened along the way.\\n\\nFor more information on the ongoing works of President Reagan's Foundation, please visit http:\/\/www.reaganfoundation.org\\n\\nFor more information on donations, visit https:\/\/support.google.com\/youtube\/?p=donate_FAQ\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/qkFlVnHVHzI\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLD9ssABASPgTQc7rPZ2oN1L7hXb1A\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/qkFlVnHVHzI\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBHSz4c8kVDoCIIZuBkfKacGzoyDQ\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/qkFlVnHVHzI\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCSlbSaS0waR_sod98q8FyQRmunSw\",\"width\":246,\"height\":138 ma. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagans presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, You do me better than I do.\\n\\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people hes impersonated and some of the funny stories that happened along the way.\\n\\nFor more information on the ongoing works of President Reagan's Foundation, please visit http:\/\/www.reaganfoundation.org\\n\\nFor more information on donations, visit https:\/\/support.google.com\/youtube\/?p=donate_FAQ\"},\"lengthSeconds\":\"3871\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/ReaganFoundation\",\"externalChannelId\":\"UCEJi23qnygQHE5UeLXoV_JQ\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\" ps://yt3.ggpht.com/a/AATXAJxZnlZG111_5E30r3JkX6SifxVoN9MoXtUKMw=s88-c-k-c0xffffffff-no-rj-mo","width":88,"height":88},{"url":"https://yt3.ggpht.com/a/AATXAJxZnlZG111_5E30r3JkX6SifxVoN9MoXtUKMw=s176-c-k-c0xffffffff-no-rj-mo","width":176,"height":176}]},"title":{"runs":[{"text":"ReaganFoundation","navigationEndpoint":{"clickTrackingParams":"CJcBEOE5IhMIi7zFxM2T6gIVG0J6BR2_cgNL","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCEJi23qnygQHE5UeLXoV_JQ","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCEJi23qnygQHE5UeLXoV_JQ"}}}]},"subscriptionButton":{"type":"FREE"},"navigationEndpoint":{"clickTrackingParams":"CJcBEOE5IhMIi7zFxM2T6gIVG0J6BR2_cgNL","commandMetadata":{"webCommandMetadata":{"url":"/user/ReaganFoundation","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCEJi23qnygQHE5UeLXoV_JQ","canonicalBaseUrl":"/user/ReaganFoundation"}},"subscriberCountText":{"runs":[{"text":"78.2K subscribers"}]},"trackingParams":"CJcBEOE5IhMIi7zFxM2T6gIVG0J6BR2_cgNL"}},"description":{"runs":[{"text":"Please join us for an evening with comedian, actor, artist and entertainment legend Rich Little, who will be here to discuss his new book, Little by Little: People Ive Known and Been (Publish Date: August 8, 2016), as well as to share stories of his time spent with President Reagan. Tickets to the event are $56 per person and include a buffet dinner in the Air Force One Pavilion following the program. Books must be purchased in the Reagan Library Museum Store to receive signature.\n\nRich Little is a master mimic of more than 200 voices and currently has a Las Vegas Show at the Tropicana Hotel. Rich Little has a voice for every administration including U.S. Presidents: John F. Kennedy, Lyndon Johnson, Richard Nixon, Gerald Ford, Jimmy Carter, Ronald Reagan, Bill Clinton, both George Bushes and Barack Obama. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagans presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, You do me better than I do.\n\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people hes impersonated and some of the funny stories that happened along the way.\n\nFor more information on the ongoing works of President Reagan's Foundation, please visit "},{"text":"http://www.reaganfoundation.org","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIi7zFxM2T6gIVG0J6BR2_cgNLSLK-1I7nqtmgqgE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=qkFlVnHVHzI\u0026event=video_description\u0026redir_token=XyPB2C902A-TqqIvbEpk84oHGyZ8MTU5Mjg1Mjg4NUAxNTkyNzY2NDg1\u0026q=http%3A%2F%2Fwww.reaganfoundation.org","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=qkFlVnHVHzI\u0026event=video_description\u0026redir_token=XyPB2C902A-TqqIvbEpk84oHGyZ8MTU5Mjg1Mjg4NUAxNTkyNzY2NDg1\u0026q=http%3A%2F%2Fwww.reaganfoundation.org","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nFor more information on donations, visit "},{"text":"https://support.google.com/youtube/?p...","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIi7zFxM2T6gIVG0J6BR2_cgNLSLK-1I7nqtmgqgE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=qkFlVnHVHzI\u0026event=video_description\u0026redir_token=XyPB2C902A-TqqIvbEpk84oHGyZ8MTU5Mjg1Mjg4NUAxNTkyNzY2NDg1\u0026q=https%3A%2F%2Fsupport.google.com%2Fyoutube%2F%3Fp%3Ddonate_FAQ","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=qkFlVnHVHzI\u0026event=video_description\u0026redir_token=XyPB2C902A-Tqq gan","First Lady","POTUS","FLOTUS","Rich Little","Comedian","Actor","Artist"],"channelId":"UCEJi23qnygQHE5UeLXoV_JQ","isOwnerViewing":false,"shortDescription":"Please join us for an evening with comedian, actor, artist and entertainment legend Rich Little, who will be here to discuss his new book, Little by Little: People Ive Known and Been (Publish Date: August 8, 2016), as well as to share stories of his time spent with President Reagan. Tickets to the event are $56 per person and include a buffet dinner in the Air Force One Pavilion following the program. Books must be purchased in the Reagan Library Museum Store to receive signature.\n\nRich Little is a master mimic of more than 200 voices and currently has a Las Vegas Show at the Tropicana Hotel. Rich Little has a voice for every administration including U.S. Presidents: John F. Kennedy, Lyndon Johnson, Richard Nixon, Gerald Ford, Jimmy Carter, Ronald Reagan, Bill Clinton, both George Bushes and Barack Obama. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagans presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, You do me better than I do.\n\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people hes impersonated and some of the funny stories that happened along the way.\n\nFor more information on the ongoing works of President Reagan's Foundation, please visit http://www.reaganfoundation.org\n\nFor more information on donations, visit https://support.google.com/youtube/?p=donate_FAQ
